              appendTo(pagerNumber);
            $('<li/>').
              append($('<a/>').
                attr('title', title.last).
                addClass(pfx + 'datatable-pager-link ' + pfx + 'datatable-pager-link-last').
                append($('<i/>').addClass(icons.last)).
                on('click', pg.gotoMorePage).
                attr('data-page', pg.meta.pages)).
              appendTo(pagerNumber);

