                start: pg.meta.total === 0 ? 0 : start,
                end: pg.meta.perpage === -1 ? pg.meta.total : end,
                pageSize: pg.meta.perpage === -1 ||
                pg.meta.perpage >= pg.meta.total
                  ? pg.meta.total
                  : pg.meta.perpage,
                total: pg.meta.total,
